import React from 'react';
import PropTypes from 'prop-types';

import '../../../style/sudoku.css';


import {
  ConfirmButton,
  CancelButton,
  ButtonBox,
  Message,
} from './validate.styled';



export default class Reset extends React.Component {
  static propTypes = {
    onAction: PropTypes.func.isRequired,
    onClose: PropTypes.func.isRequired,
  };

  render() {
    const { primaryAction, cancelAction } = this.props;

    return (
      <div id="validate_box">
        <div id="validate_message">
          Do you wish to validate the board?
        </div>

        <div className="cancel_or_confirm">
          <button className='confirm_btn' onClick={cancelAction}>Yes</button>
          <button className='cancel_btn' onClick={primaryAction}>No</button>
        </div>

      </div>
    );
  }
}
